import { useEffect, useState } from "react";
import React from "react";
import uuid from "react-uuid";

function App() {
   const mockTodos = [
      { id: "1", title: "Needed text", completed: "true" },
      { id: "2", title: "Needed ", completed: "true" },
      { id: "2", title: "Text ", completed: "true" },
   ];
   const [TodosList, setTodosList] = useState([mockTodos]);
   return (
      <div>
         {TodosList.map((todo) => {
            <div key={uuid()}>
               <h1>{todo.id}</h1>
               <p>{todo.title}</p>
            </div>;
         })}
      </div>
   );
}

export default App;
